"original": |2-
     A response MAY contain attribute groups, attributes, attribute
     syntaxes, values, and status-code values that the Client does not
     expect.  Therefore, a Client implementation MUST gracefully handle
     such responses and not refuse to interoperate with a conforming
     Printer that is returning Standards Track extensions or vendor
     extensions, including attribute groups, attributes, attribute
     syntaxes, attribute values, status-code values, and out-of-band
     attribute values that conform to Section 7.  Clients can choose to
     ignore any parameters, attribute groups, attributes, attribute
     syntaxes, or values that they do not understand.
"fixed": |-
  A response MAY contain attribute groups, attributes, attribute syntaxes, values, and status-code values that the Client does not expect.  Therefore, a Client implementation MUST gracefully handle such responses and not refuse to interoperate with a conforming Printer that is returning Standards Track extensions or vendor extensions, including attribute groups, attributes, attribute syntaxes, attribute values, status-code values, and out-of-band attribute values that conform to Section 7.  Clients can choose to ignore any parameters, attribute groups, attributes, attribute syntaxes, or values that they do not understand.
"ko": |-
  응답에는 클라이언트가 예상하지 않는 속성 그룹, 속성, 속성 구문, 값 및 상태 코드 값이 포함될 수 있습니다. 따라서 클라이언트 구현은 이러한 응답을 적절하게 처리해야 하며, 속성 그룹, 속성, 속성 구문, 속성 값, 상태 코드 값 및 out-of-of-of-of-of-of-of-of-out-of-at-groups, 속성, 속성 구문을 포함하여 표준 추적 확장 또는 공급업체 확장을 반환하는 적합한 프린터와의 상호 운용을 거부해서는 안 됩니다. - 섹션 7을 준수하는 밴드 속성 값. 클라이언트는 이해하지 못하는 매개변수, 속성 그룹, 속성, 속성 구문 또는 값을 무시하도록 선택할 수 있습니다.
